func (o *FSZone) Preload(name string, retrieved any) error {
	if o == nil {
		return nil
	}

	switch name {
	case "Organization":
		rel, ok := retrieved.(*Organization)
		if !ok {
			return fmt.Errorf("fsZone cannot load %T as %q", retrieved, name)
		}

		o.R.Organization = rel

		if rel != nil {
			rel.R.FSZones = FSZoneSlice{o}
		}
		return nil
	default:
		return fmt.Errorf("fsZone has no relationship %q", name)
	}
}

