// LoadOrganization loads the fsZone's Organization into the .R struct
func (o *FSZone) LoadOrganization(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if o == nil {
		return nil
	}

	// Reset the relationship
	o.R.Organization = nil

	related, err := o.Organization(mods...).One(ctx, exec)
	if err != nil {
		return err
	}

	related.R.FSZones = FSZoneSlice{o}

	o.R.Organization = related
	return nil
}

// LoadOrganization loads the fsZone's Organization into the .R struct
func (os FSZoneSlice) LoadOrganization(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if len(os) == 0 {
		return nil
	}

	organizations, err := os.Organization(mods...).All(ctx, exec)
	if err != nil {
		return err
	}

	for _, o := range os {
		if o == nil {
			continue
		}

		for _, rel := range organizations {

			if !(o.OrganizationID == rel.ID) {
				continue
			}

			rel.R.FSZones = append(rel.R.FSZones, o)

			o.R.Organization = rel
			break
		}
	}

	return nil
}

type fsZoneJoins[Q dialect.Joinable] struct {
	typ          string
	Organization modAs[Q, organizationColumns]
}

func (j fsZoneJoins[Q]) aliasedAs(alias string) fsZoneJoins[Q] {
	return buildFSZoneJoins[Q](buildFSZoneColumns(alias), j.typ)
}

func buildFSZoneJoins[Q dialect.Joinable](cols fsZoneColumns, typ string) fsZoneJoins[Q] {
	return fsZoneJoins[Q]{
		typ: typ,
		Organization: modAs[Q, organizationColumns]{
			c: Organizations.Columns,
			f: func(to organizationColumns) bob.Mod[Q] {
				mods := make(mods.QueryMods[Q], 0, 1)

				{
					mods = append(mods, dialect.Join[Q](typ, Organizations.Name().As(to.Alias())).On(
						to.ID.EQ(cols.OrganizationID),
					))
				}

				return mods
			},
		},
	}
}
